class YOLOEvaluator:
    """
    Класс для оценки модели YOLO: вычисление mean IoU и Precision-Recall Curve.
    """
    def __init__(self, model, test_images_folder, results_path):
        self.model = model
        self.test_images_folder = test_images_folder
        self.results_path = results_path
        os.makedirs(self.results_path, exist_ok=True)

    def evaluate(self):
        results = self.model.val()
        mean_ap50 = results.box.map50
        mean_ap50_95 = results.box.map

        with open(os.path.join(self.results_path, "mean_ap.txt"), "w") as f:
            f.write(f"mAP50: {mean_ap50:.4f}\n")
            f.write(f"mAP50-95: {mean_ap50_95:.4f}\n")

        print(f"mAP50: {mean_ap50:.4f}, mAP50-95: {mean_ap50_95:.4f}")
        return mean_ap50, mean_ap50_95

    def plot_precision_recall(self):
        results = self.model.val()
        if hasattr(results.box, "curves_results") and len(results.box.curves_results) > 0:
          pr_curve = results.box.curves_results[0]

        recall = pr_curve[0]
        precision = pr_curve[1].flatten()
        min_len = min(len(recall), len(precision))
        recall = recall[:min_len]
        precision = precision[:min_len]

        plt.figure(figsize=(6, 6))
        plt.plot(recall, precision, marker=".", label="Precision-Recall Curve")
        plt.xlabel("Recall")
        plt.ylabel("Precision")
        plt.title("Precision-Recall Curve")
        plt.legend()
        plt.grid()

        pr_curve_path = os.path.join(self.results_path, "pr_curve.png")
        plt.savefig(pr_curve_path)
        plt.show()
        print(f"Precision-Recall Curve сохранен: {pr_curve_path}")

class YOLOPredictor:
    """
    Класс для выполнения предсказаний YOLO на тестовых данных
    """
    def __init__(self, model, test_images_folder, predictions_path):
        self.model = model
        self.test_images_folder = test_images_folder
        self.predictions_path = predictions_path
        os.makedirs(self.predictions_path, exist_ok=True)

    def predict(self):

        self.model.predict(
            source=self.test_images_folder,
            save=True,
            save_txt=True,
            save_conf=True,
            project=self.predictions_path,
            iou=0.7
        )
        predictions_folder = os.path.join(self.predictions_path, "results")
        print(f"Предсказания сохранены в {predictions_folder}")

